import React from 'react';
import { useEffect } from 'react';
import './App.css';
import SearchIcon from './search.svg';
const API_URL = 'http://www.omdbapi.com/?apikey=e38ec450&s';
const movie1 = {
    "Title": "Good Will Hunting", 
    "Year": "1997", 
    "imdbID": "tt0119217", 
    "Type": "movie", 
    "Poster": "https://m.media-amazon.com/images/M/MV5BOTI0MzcxMTYtZDVkMy00NjY1LTgyMTYtZmUxN2M3NmQ2NWJhXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg"
}
const App = () => {
    const searchMovies = async (title) => {
        const response = await fetch(`${API_URL}&s=${title}`);
        const data = await response.json();
        console.log(data);
        console.groupCollapsed(data.Search);
    }
    useEffect(() => {
        searchMovies('Good Will Hunting');
    }, []);
    return (
        <div className="App">  
            <h1>Movieland</h1>
            <div className="search">
                <input 
                type="text" 
                placeholder="Search for a movie" 
                value="Superman"
                onChange={()=>{}}
                />
                <img src={SearchIcon} alt="Search" 
                onClick={()=>{}}/>
            </div>
            <div className="container">
                <div className="movie">
                    <div>
                        <p>{movie1.Year}</p>
                    </div>
                    <div>
                        <img src={movie1.Poster !== 'N/a' ? movie1.Poster: 'https://via.placeholder.com/400'}
                        alt={movie1.Title} />
                    </div>
                    <div>
                        <span>
                            {movie1.Type}
                            <h3> {movie1.Title}</h3>
                        </span>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
